import React from "react";
import DealsTable from "./Components/DealsTable";
import Footer from "./Components/Footer";

const Admin = ({
  handleLogged,
  deals,
  handleDeclineDeal,
  handleApproveDeal,
}) => {
  return (
    <div>
      <DealsTable
        deals={deals}
        handleDeclineDeal={handleDeclineDeal}
        handleApproveDeal={handleApproveDeal}
      />
      <Footer handlelogged={handleLogged} />
    </div>
  );
};

export default Admin;
